import React from 'react'
import { Link, Router } from 'react-router-dom';
import './headerStyle.css';

function Header(){
    return (
        <div>

            <header>
                <a href="#showcase"><img className="branding-icon" src="./images/Logo-2.png" alt="branding" /></a>
                <div className="nav">
                    <ul>
                        <li><button  className="heading-course"><Link to="/courses"><span>COURSES</span> </Link></button></li>
                        <li><Link to="/wishlist"><span className="heading-wishlist">MY WISHLIST</span></Link></li>
                        <li><Link to="/cart"><img className="cart-icon" src="./images/Shopping-Cart.svg" alt="cart-icon" /></Link></li>
                        <li><Link to="/profile"><img className="profile-icon" src="./images/noun_profile_2068277.svg" alt="profile-icon" /></Link></li>
                    </ul>
                </div>
            </header>
        </div>
    )
}

export default Header;
